import React from 'react';
import './App.css';
import Header from './components/Header';
import List from './components/List';
// import Table from './Table';

function App() {

  const list = ['shabir','abul','musthafa','siddiq'];

  return (
    <>
      <h2>Bismillah</h2>
      {/* <Table/> */}
      <Header />

    <List names ={list}/>
    </>
  );
}

export default App;
